import React from 'react'
import AddIcon from "@mui/icons-material/Add";
const AddButton = () => {
  return (
    <div style={{ backgroundColor: "#0D28F4",padding:"10px",borderRadius:"100px" }}>
      <AddIcon style={{color:"white",position:"relative",top:"2"}} />
    </div>
  );
}

export default AddButton
